<div>
<img src={mail} alt="mail_pic" className="mail1">


</img>



<input type="text" className="inputs1" placeholder="         username@gmail.com"/>







</div>



<div>
<img src={pass} alt="mail_pic" className="mail1">


</img>



<input type="text" className='inputs1' placeholder="         ************"/>








</div>

<button  className='login' onClick={()=>{st(true);}} >Sign in</button>
<br></br><br></br>
<button className='btns' onClick={()=>{st1(true);}}>sign in as a supervisor</button> 

<button className='btns' onClick={()=>{st2(true);}}>sign in as a jury</button> 
<br></br>
<a href="" className='link' > forget password ?  </a>

</div>




</div>


</div>


  )
};
